import React from "react";
import { Route, Routes } from "react-router-dom";
import Header from "./components/header/header";
import Footer from "./components/footer/footer";
import Components from "./views/components/components";

const App = () => {
  return (
    <div>
      <Header />
      <Routes>
        <Route path="/" element={<Components />} />
        <Route path="/survey" element={<Gender />} setSurvey={setSurvey} />
        <Route path="/survey/age" element={<Age />} setSurvey={setSurvey} />
        <Route path="/survey/item" element={<Item />} setSurvey={setSurvey} />
        <Route path="/survey/result" element={<Result />} survey={survey} />
        <Route path="/main" element={<Main />} />
        <Route path="/mypage" element={<Mypage />} />
        <Route path="/wishlist" element={<WishList />} />
      </Routes>
      <Footer />
    </div>
  );
};

export default App;
